import React from "react";
import './header.css';

function Nav () {
    return (
        <div className="nav-links">
            <nav>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                    <li>Skills</li>
                    <li>Projects</li>
                    <li>Contact</li>
                </ul>
            </nav>
        </div>
    );
}

export default Nav;
